import React from 'react';
import styled from 'styled-components';

export const Signuppage: React.FC = () => {
  return (
  <StyledSignup>
    <StyledTitle>Registration</StyledTitle>
    <StyledForm>
      <StyledFormItem>
        <StyledLabel>Login</StyledLabel>
        <StyledInput type='text'></StyledInput>
      </StyledFormItem>
      <StyledFormItem>
        <StyledLabel>E-mail</StyledLabel>
        <StyledInput type='email'></StyledInput>
      </StyledFormItem>
      <StyledFormItem>
        <StyledLabel>Password</StyledLabel>
        <StyledInput type='password'></StyledInput>
      </StyledFormItem>
      <StyledFormItem>
        <StyledLabel>Confirm password</StyledLabel>
        <StyledInput type='password'></StyledInput>
      </StyledFormItem>
      <StyledFormItem>
        <StyledLabel>Fullname</StyledLabel>
        <StyledInput type='text'></StyledInput>
      </StyledFormItem>
      <StyledButton>Register</StyledButton>
    </StyledForm>
  </StyledSignup>
)};

const StyledSignup = styled.div`
  background-color: #0069a5;
  text-align: center;
  color: #eee;
  font-size: 35px;
  height: 100vh;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const StyledTitle = styled.h1`
  font-size: 50px;
`;

const StyledForm = styled.div`
  background-color: #ebecf0;
  color: #1b1b1b;
  font-size: 15px;
  width: 500px;
  height: fit-content;
  border-radius: 10px;
  padding: 10px 15px;
`;

const StyledFormItem = styled.div`
  display: flex;
  flex-direction: column;
  margin: 25px 0;
`;

const StyledLabel = styled.label`
  margin-bottom: 10px;
  text-align: left;
  font-size: 16px;
  font-style: italic;
`;

const StyledInput = styled.input`
  border: none;
  border-radius: 5px;
  height: 37px;
  font-size: 18px;
`;

const StyledButton = styled.button`
  padding: 10px 10px;
  margin-right: 20px;
  color: #eef;
  background-color: #ff9926;
  border: none;
  border-radius: 8px;
  text-decoration: none;
  transition: .2s;

  &:hover {
    color: #f88400;
    border-color: #f88400;
  }
`;
